import React from 'react';

const DashboardAdmin = () => {
    const employees = [
        { id: 1, name: 'John Doe' },
        { id: 2, name: 'Jane Smith' },
        // Add more employees here
    ];

    const clients = [
        { id: 1, name: 'Client A' },
        { id: 2, name: 'Client B' },
        // Add more clients here
    ];

    return (
        
        <div className="grid grid-cols-2 gap-4 bg-purple-500 p-4">
            <div>
                <h1 className="text-white text-2xl font-bold mb-4">Dashboard Admin</h1>
                <p className="text-white">Vous êtes connecté en tant qu'administrateur</p>
            </div>
            <div>
                <h2 className="text-white text-xl font-bold mb-4">Liste des employés :</h2>
                <ul className="text-white">
                    {employees.map((employee) => (
                        <li key={employee.id}>{employee.name}</li>
                    ))}
                </ul>
            </div>
            <div>
                <h2 className="text-white text-xl font-bold mb-4">Liste des clients :</h2>
                <ul className="text-white">
                    {clients.map((client) => (
                        <li key={client.id}>{client.name}</li>
                    ))}
                </ul>
            </div>
        </div>
    );
};

export default DashboardAdmin;
